// App.js
import './App.css';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route path='/' exact>
          {/* Component to render when the '/' route is matched */}
          {/* Add your component here */}
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
